function getProductInfo() {
    // 获取商品id
    var skuId = "";
    // 优先解析购物按钮数据
    var buyForm = document.querySelector("#module_add_to_cart > .pdp-cart-concern > form > input");
    if (buyForm != null) {
        var buyFormData = JSON.parse(buyForm.value);
        if (typeof buyFormData['items'] != 'undefined') {
            if (typeof buyFormData['items'][0]['itemId'] != 'undefined' && typeof buyFormData['items'][0]['skuId'] != 'undefined') {
                skuId = buyFormData['items'][0]['itemId'] + "_TH-" + buyFormData['items'][0]['skuId'];
            }
        }
    }
    if (skuId.length == 0) {
        // 再解析dom中的sku信息
        var skuIdDOM = document.querySelector(".specification-keys > li:nth-child(2) .key-value");
        if (skuIdDOM == null) {
            // 再解析脚本数据
            var scriptDataDom = document.querySelectorAll("script[type='application/ld+json']");
            for (const element of scriptDataDom) {
                var data = JSON.parse(element.innerText)
                if (typeof data['sku'] != 'undefined') {
                    skuId = data['sku'];
                    break;
                }
            }
        } else {
            skuId = skuIdDOM.innerText;
        }
    }
    // 获取类目信息
    var categoryDom = document.querySelectorAll('.breadcrumb_item');
    var category = [];
    for (var i = 0; i < categoryDom.length - 1; i++) {
        category.push(categoryDom[i].innerText.replace(/(^\s*)|(\s*$)/g, ""));
    }
    var productInfo = {};
    productInfo.productId = skuId.split('_')[0];
    productInfo.lazadaSku = skuId;
    productInfo.skuId = skuId.split('-')[1];
    productInfo.name = document.querySelector(".pdp-mod-product-badge-title").innerText;
    productInfo.currentPrice = document.querySelector(".pdp-product-price > span:first-child").innerText;
    productInfo.image = document.querySelector(".gallery-preview-panel__image").src;
    productInfo.category = category;
    productInfo.url = window.location.href;
    productInfo.productCommissionRate = "3";
    productInfo.sort = "999999999";
    var marketPriceDom = document.querySelector(".pdp-product-price > .origin-block > span:first-child");
    productInfo.price = marketPriceDom === null ? productInfo.currentPrice : marketPriceDom.innerText;
    productInfo.brandName = document.querySelector(".pdp-product-brand > .pdp-product-brand__brand-link").innerText;
    productInfo.sellerName = document.querySelector(".seller-name__detail > .seller-name__detail-name").innerText;
    // 去除webp
    if (productInfo.image.substr(-5) == ".webp") {
        productInfo.image = productInfo.image.substr(0, productInfo.image.length - 5).replace(/^(\s|_)+|(\s|_)+$/g, '');
    }
    return productInfo;
}

