function hoverButton() {
    var hoverImg = document.createElement("img");
    hoverImg.src = hoverImgData;
    hoverImg.className = "ypk-hover-img";
    hoverImg.addEventListener("click", function () {
        if (checkLanguage()) {
            // 是英语环境
            if (document.getElementById("ypk-box") === null) {
                render();
            } else {
                var mask = document.getElementById("ypk-mask");
                if (mask !== null) {
                    mask.remove();
                }
                closeEvent();
            }
        } else {
            // 非英语环境，提示切换语言
            alertLanguage();
        }
    });
    document.body.appendChild(hoverImg);
}

function closeEvent() {
    var box = document.getElementById("ypk-box");
    if (box !== null) {
        box.remove();
    }
}

function submitEvent(productInfo) {
    if (productInfo.sort === "" || productInfo.sort === null) {
        createPop(renderLanguage("sortnotempty"), 'error');
        return;
    }
    if (productInfo.productCommissionRate === "" || productInfo.productCommissionRate === null) {
        createPop(renderLanguage("commissionratiocannotempty"), 'error');
        return;
    }
    // var baseUrl = 'https://api.youpik.com';
    var baseUrl = 'https://youpik.test.catike.com';
    postRequest(baseUrl + '/api-mall/lazada/affiliate/item/query_lazada_category', {
        "categoryNames": productInfo.category
    }, function (response) {
        if (response.code == 200) {
            var submitData = {
                "productId": productInfo.productId,
                "productName": productInfo.name,
                "productImg": productInfo.image,
                "categoryId": response.result.id,
                "categoryName": response.result.categoryName,
                "price": productInfo.price.substr(1).replace(/,/g, ''),
                "currency": 'THB',
                "sellerName": productInfo.sellerName,
                "currentPrice": productInfo.currentPrice.substr(1).replace(/,/g, ''),
                "brandName": productInfo.brandName,
                "productUrl": productInfo.url,
                "skuId": productInfo.skuId,
                "productCommissionRate": productInfo.productCommissionRate / 100,
                "lazadaSku": productInfo.lazadaSku,
                "sort": productInfo.sort,
                "bestState": document.querySelector("#home-featured").checked === true
            };
            // 提交商品
            postRequest(baseUrl + '/api-mall/lazada/affiliate/item/batch_sync', {
                "items": [submitData],
                "needRootLink": true
            }, function (response) {
                if (response.code == 200) {
                    setTimeout(function () {
                        createPop(renderLanguage("submitproductsuccess"), "success");
                    }, 200);
                } else {
                    createPop(renderLanguage("submitproducterror") + ': ' + response.message, 'error');
                }
            }, function (xhr) {
                createPop(renderLanguage("submitproducterror"), 'error');
            }, function () {
                var mask = document.getElementById("ypk-mask");
                if (mask !== null) {
                    mask.remove();
                }
                closeEvent();
            });
        } else {
            createPop(renderLanguage("categoryerror") + ': ' + response.message, 'error');
        }
    }, function (xhr) {
        createPop(renderLanguage("categoryerror"), 'error');
    }, function () {});
}

// 发起post请求
function postRequest(url, data, successCallback, errorCallback, finallyCallback) {
    var xhr = new XMLHttpRequest();
    xhr.onreadystatechange = function () {
        if (xhr.readyState === 4) {
            if (xhr.status >= 200 && xhr.status < 300 || xhr.status == 304) {
                var response = JSON.parse(xhr.responseText);
                typeof successCallback === 'function' && successCallback(response);
                typeof finallyCallback === 'function' && finallyCallback(xhr);
            } else {
                typeof errorCallback === 'function' && errorCallback(xhr);
                typeof finallyCallback === 'function' && finallyCallback(xhr);
            }
        }
    }
    xhr.open('POST', url, true);
    xhr.setRequestHeader('Content-Type', 'application/json');
    xhr.send(JSON.stringify(data));
}

// 检查当前页面语言选项
function checkLanguage() {
    var isEnglish = false;
    var cookies = document.cookie.split(';');
    for (var i = 0; i < cookies.length; i++) {
        if (cookies[i].indexOf('userLanguageML') > -1) {
            var language = cookies[i].split('=')[1];
            if (language === 'en') {
                isEnglish = true;
            }
            break;
        }
    }
    return isEnglish;
}

// 提示切换语言
function alertLanguage() {
    if (document.querySelector(".ypk-bubble") !== null) {
        var mask = document.getElementById("ypk-mask");
        if (mask !== null) {
            mask.remove();
        }
        closeAlertLanguage();
        return;
    }
    document.body.scrollTop = document.documentElement.scrollTop = 0;
    document.body.style.overflow = 'hidden';
    // 创建遮罩层
    var mask = createMask(closeAlertLanguage);
    var navDom = document.querySelector("#topActionLinks > div");
    navDom.appendChild(mask);
    var switchLangDom = document.getElementById("topActionSwitchLang");
    switchLangDom.style.backgroundColor = "white";
    switchLangDom.classList.add("ypk-top-level");
    // 创建气泡
    var bubbleDom = document.createElement("div");
    bubbleDom.className = "ypk-bubble";
    bubbleDom.innerText = renderLanguage("switchlang");
    switchLangDom.appendChild(bubbleDom);
}

function closeAlertLanguage() {
    var bubble = document.querySelector(".ypk-bubble");
    if (bubble !== null) {
        bubble.remove();
    }
    var topActionSwitchLang = document.getElementById("topActionSwitchLang");
    topActionSwitchLang.style.backgroundColor = "";
    topActionSwitchLang.classList.remove("ypk-top-level");
    document.body.style.overflow = '';
}

// 创建遮罩层   
function createMask(callback) {
    var mask = document.createElement("div");
    mask.id = "ypk-mask";
    mask.style.position = "fixed";
    mask.style.top = "0px";
    mask.style.left = "0px";
    mask.style.width = "100%";
    mask.style.height = "100%";
    mask.style.backgroundColor = "rgba(0,0,0,0.5)";
    mask.style.zIndex = "1100000";
    mask.style.cursor = "pointer";
    mask.addEventListener("click", function () {
        var mask = document.getElementById("ypk-mask");
        if (mask !== null) {
            mask.remove();
        }
        callback();
    });
    return mask;
}

