// 多语言渲染
function renderLanguage(strKey) {
    var lang = navigator.language || navigator.userLanguage;
    lang = lang.toLowerCase().split("-")[0];
    if (languageMap[strKey] && languageMap[strKey][lang]) {
        return languageMap[strKey][lang];
    } else {
        return languageMap[strKey]["en"];
    }
}

/**
 * 根据当前语言，增加语言css样式
 *
 * @author Huang Mingchao
 * @param {*} dom DOM节点
 * @param {*} style 不为null的时候为指定样式，可选值：default、w-2
 */
function addLanguageCss(dom, style) {
    var lang = navigator.language || navigator.userLanguage;
    lang = lang.toLowerCase().split("-")[0];
    switch (lang) {
        case "en":
            dom.classList.add("ypk-lang-en");
            if (style) {
                dom.classList.add("ypk-lang-en-" + style);
            }
            break;
        case "th":
            dom.classList.add("ypk-lang-th");
            if (style) {
                dom.classList.add("ypk-lang-th-" + style);
            }
            break;
        default:
    }
}
